  "Broker Comment" : "WHILE PRESIDENT OF CONEJO SECURITIES CORP. (CSC) IN 1984, ONE OF MR. IRWIN'S REGISTERED REPRESENTATIVES SERVED AS A GENERAL PARTNER FOR A PRIVATE PARTNERSHIP. THE REGISTERED REP. WAS LATER FINED FOR VIOLATION OF ARTICLE III SECTION 1 OF THE RULES OF FAIR PRACTICE IN THAT HE FAILED TO MAINTAIN ESCROW; PROMPTLY TRANSMIT FUNDS TO ESCROW; REFUND PURCHASES WHEN MINIMUM NUMBER OF UNITS WERE NOT SOLD; KEEP ACCURATE RECORDS AND SERVE IN THE CAPACITY OF PRINCIPAL WITHOUT A SERIES 24 LICENSE. MR. IRWIN WAS FINED AND CHARGED WITH THE SAME OFFENSES BECAUSE AS PRESIDENT OF CSC HE ALLOWED OR DID NOT CORRECT THE FOREGOING OFFENSES. IT SHOULD BE NOTED THAT THE OFFENDING REPRESENTATIVE WAS LISTED AS CHAIRMAN OF THE BOARD OF CSC IN THE INITIAL NASD BROKER-DEALER LICENSING APPLICATION. IT SHOULD ALSO BE NOTED THAT NO CIVIL OR CRIMINAL CHARGES WERE ALLEGED OR FILED BY THE NASD."
